import { HomePage } from './Components/HomePage';
import { Route, Link, BrowserRouter,Switch  } from 'react-router-dom'

//Style Of Component
import './App.scss';


function App() {
  return (
    <div className="App">
    <BrowserRouter> 
      <Switch>
        <Route  exact path='/' component={HomePage}/>
      </Switch>   
    </BrowserRouter>

    </div>
  );
}

export default App;
